DO $$
DECLARE 
    empresa_lo INTEGER;  
    idseq BIGINT;
    dt_emi DATE;
BEGIN
    SELECT ID_EMPRESA$LO FROM EMPRESA$LO WHERE CH_LOCAL = 'T' LIMIT 1 INTO empresa_lo;
    perform set_config('myvars.ID_EMPRESA', empresa_lo::text, true);

    dt_emi = '2021-07-13';

    idseq = NEXTVAL('gen_cartao_mov');  


END$$;